INSERT INTO `events` (`id`,`event_title`,`title_arabic`,`event_description`,`desc_arabic`,`test_drive`,`drive_arabic`,`image`,`thumb`,`full_path`,`event_location`,`location_arabic`,`event_start_date`,`event_end_date`,`status`,`create_date`) VALUES
('6','Second Social Gathering','  ','The feature to book test drives on the site is great. Not many websites have all the brands under one roof. However, carmakers have let users book test drives on their official websites. For first time buyers who have no previous brand allegiance, this is a great service. The site needs a lot of work on the information side. For instance, the advance information tab in the browse cars page displays just basic ratings with no explanation or information about the vehicle.','       .            .             .              .         .                      .','The feature to book test drives on the site is great. Not many websites have all the brands under one roof. However, carmakers have let users book test drives on their official websites. For first time buyers who have no previous brand allegiance, this is a great service. The site needs a lot of work on the information side. For instance, the advance information tab in the browse cars page displays just basic ratings with no explanation or information about the vehicle.','         .             .      ','image-new.jpg','slider/thumb/image-new.jpg','slider/image-new.jpg','chd','','2016-02-27','2016-02-29','active','2016-02-19');
