INSERT INTO `faq` (`id`,`question_arabic`,`answer_arabic`,`question`,`answer`,`show`) VALUES
('4','-        ','-       \"  \"            \"\"     ','Where can I find information about a specific car?','Go to the Homepage, click on \"Find Your Car\", and fill in the information for the specific car you are looking for. Then click search, you will get the results you are looking for.','yes');
INSERT INTO `faq` (`id`,`question_arabic`,`answer_arabic`,`question`,`answer`,`show`) VALUES
('5','-       ','-              .','Will Al-Wakalat charge me anything?','No, we provide you with our great services for free as we aim to optimize your new-car shopping experience.','yes');
INSERT INTO `faq` (`id`,`question_arabic`,`answer_arabic`,`question`,`answer`,`show`) VALUES
('6','-      ','-    \"\"    /              .','How do I contact dealers for more information?','Go to our \"Partners\" page, click on the dealer/partner you are interested in and you will be able to view their contact information, address and location on map.','yes');
INSERT INTO `faq` (`id`,`question_arabic`,`answer_arabic`,`question`,`answer`,`show`) VALUES
('7','-    ','-                           5%  45%                       2016.','What is Al-Mulatham Card?','It is a subscription that gives you the exclusive privileges of an Al-Wakalat visitor. When you buy this card you can get discounts from 5% up to 45% on services from our partners ranging from car cleaning and detailing to painting and wrapping. This card is only valid until the end of the year you buy it in. Current expiration day for the card is December 31st, 2016.','yes');
INSERT INTO `faq` (`id`,`question_arabic`,`answer_arabic`,`question`,`answer`,`show`) VALUES
('8','.      ','.             ','Where can I find out about any upcoming events?','Go to the Events page, as it has a list of the events that are taking place soon with all the information about them.','yes');
INSERT INTO `faq` (`id`,`question_arabic`,`answer_arabic`,`question`,`answer`,`show`) VALUES
('10','-      ','-         \" \"           .','How do I contact Al-Wakalat for queries?','You can send us a message with your query if you go to the Contact Us page and fill the message form provided, and we will reply to you as soon as possible.','yes');
INSERT INTO `faq` (`id`,`question_arabic`,`answer_arabic`,`question`,`answer`,`show`) VALUES
('9','-          ','-     \"\"           .','If I want to buy a car, what are my finance options?','If you go to the Finance page on our website, you will be provided with a list of the best options for you in terms of Banks, Down Payments and Flat Rates, and with direct links to each of the banks financing application pages.','yes');
