INSERT INTO `page` (`id`,`page_title`,`page_title_arabic`,`content`,`content_arabic`,`image_name`,`full_path`,`thumb`) VALUES
('1','about AlWakalat',' ','<p><strong>Al Wakalat</strong>&nbsp;is the first online showroom to host automobile dealerships in Qatar and soon, the region.</p>
INSERT INTO `page` (`id`,`page_title`,`page_title_arabic`,`content`,`content_arabic`,`image_name`,`full_path`,`thumb`) VALUES
('2','Advertise with us',' ','<p>Al Wakalat is a dealership-driven website that only works with official automobile showrooms to advertise their automobiles. If you are representing an official dealer and considering working with us to enhance your customer base. Please contact us by filling the form provided below, or by calling us on +974 55448915, to communicate further with you according to your needs and our specification.</p>','<p>&nbsp;</p>
INSERT INTO `page` (`id`,`page_title`,`page_title_arabic`,`content`,`content_arabic`,`image_name`,`full_path`,`thumb`) VALUES
('3','Finance Options',' ','<p>At Al Wakalat we make your finance easier by providing you with the best finance options. Navigate through our different partners and choose your most suited one.</p>','<p>                    .</p>','','','');
INSERT INTO `page` (`id`,`page_title`,`page_title_arabic`,`content`,`content_arabic`,`image_name`,`full_path`,`thumb`) VALUES
('4','Contact Us',' ','<p>In case you need an answer that our website lack, or if you want to share something with us such as a great idea, suggestions, complain. Please contact us by filling the form and we will answer your concerns as soon as possible</p>','<p align=\"right\">                                 .</p>','','','');
